      "content": "Bên B đã mua bảo hiểm cho mọi hậu quả về tài chính thuộc trách nhiệm dân sự có thể phát sinh trong quá trình thực hiện nghĩa vụ của mình theo Hợp đồng này, và có thể phát sinh từ các thiệt hại về thân thể hoặc các thiệt hại trực tiếp khác do Bên B gây ra. SPVB cam kết mua bảo hiểm ở mức thích hợp cho trách nhiệm dân sự của mình đối với người lao động và tài sản tại cơ sở của SPVB (bao gồm cả Thiết bị thuộc sở hữu của Bên B). Mỗi Bên sẽ mua bảo hiểm ở mức thích hợp cho tài sản của mình. Mọi thương tổn do Thiết bị gây ra đối với người lao động của Bên nào thì Bên đó sẽ chịu trách nhiệm."
