      "content": "10.3.Đo Lường: Khối lượng Nito được giao sẽ được đo bằng cầu cân của SPVB. Trong trường hợp không có Phương tiện đo trên, Phương pháp đo sẽ dựa vào cầu cân tại nhà máy của Nhà thầu trước và sau khi giao Nito. Nhà Thầu cam kết sẽ phát hành Giấy biên nhận cho SPVB không quá 1 ngày sau mỗi lần giao hàng. Giấy biên nhận sẽ được SPVB ký và sử dụng để phát hành hóa đơn chi Nitơ. Độ chính xác của Giấy biên nhận phải được kiểm tra ngay sau khi giao hàng."
